enum HomophoneType: String {
    case their = "there"
    case weigh = "way"
    case knot = "not"
    case right = "ight"
    case see = "see"
    case bee = "be"
    case too = "to"
}

struct Correction {
    let type: HomophoneType
    let replacement: String
}

let corrections: [Correction] = [
    Correction(type: .their, replacement: "there"),
    Correction(type: .weigh, replacement: "way"),
    Correction(type: .knot, replacement: "not"),
    Correction(type: .right, replacement: "ight"),
    Correction(type: .see, replacement: "see"),
    Correction(type: .bee, replacement: "be"),
    Correction(type: .too, replacement: "to"),
]

func replaceHomophones(_ text: String) -> String {
    var result = ""
    for (index, word) in text.components(separatedBy: .whitespaces).enumerated() {
        let homophonesToReplace = corrections.filter { $0.matches(word) }
        if !homophonesToReplace.isEmpty {
            let newWord = homophonesToReplace.reduce(word) { "\($1.replacement)\($0)" }
