import { Injectable, NestMiddleware } from 'nestjs';
import { Observable } from 'rxjs';
import { map } from 'rxjs/operators';

@Injectable()
export class EnvMiddleware implements NestMiddleware {
  constructor() {}

  use(req: any, res: any, next: () => void): Observable<any> {
    const env = process.env.NODE_ENV;

    if (env === 'production') {
      return next().pipe(map(() => null)); // Return null to skip further processing
    } else {
      return next();
    }
  }
}
```

To use this decorator, add the following line in your `main.ts` file after importing the middleware:

```typescript
app.use(new EnvMiddleware());
```

This decorator checks the value of the `NODE_ENV` environment variable and skips further processing by returning `null` if the environment is set to production (`'production'`). Otherwise, it continues with the normal request flow. By default, NestJS will execute all middleware functions in sequence, so you can chain multiple middleware functions together. However, if you want to skip some middleware based on the environment, you can wrap them with this decorator to achieve that. This implementation also follows the SOLID principles, especially the Single Responsibility Principle, as the middleware is responsible only for checking the environment variable and returning `null` or executing the next middleware function accordingly.

