```cpp
int binarySearch(int arr[], int left, int right, int x) {
    while (left <= right) {
        int mid = left + (right - left) / 2;

        // Check if element is present at mid
        if (arr[mid] == x) {
            return mid;
        }

        // If element is smaller than mid, then it can only be present in left subarray
        if (arr[mid] > x) {
            right = mid - 1;
        }

        // Else element is larger than mid, so it can only be present in right subarray
        else {
            left = mid + 1;
        }
    }

    // Element was not present
    return -1;
}
```

This function takes four arguments: `arr`, the sorted array to search through; `left`, the index of the first element in the current subarray being searched; `right`, the index of the last element in the current subarray being searched; and `x`, the value being searched for.

