        }
        $isInSidHistory = $false
        foreach ($subAuth in $sidhistory) {
            $allSubAuths = (Get-ADGroupMember -recursive -filter {SamAccountName -eq $identity.value}) | Select-Object -ExpandProperty SidHistory | Select-Object -ExpandProperty SubAuthority
            if (-not [string]::join(" ", $allSubAuths)) {
                continue
            }
            foreach ($subAuthInGroup in $allSubAuths) {
                if ($subAuthInGroup -eq $subAuth) {
                    $isInSidHistory = $true
                    break
                }
            }
        }
        if (!$isInSidHistory) {
            return $false
        }
    }
    return $true
}
